import React from 'react';
import logo from './logo.svg';
import './App.css';
import Movie from './Movie/Movie';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Container, Row } from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <Container>
        <Row>
          <Movie />
          <Movie />
          <Movie />
          <Movie />
        </Row>
      </Container>
    </div>
  );
}

export default App;
